    represents the total contributions from individuals who have not individually
    contributed more than $200 in the aggregate during the calendar year.          10/15/2008
    \ In response to the letter dated 9/19/2008 regarding the outstanding balance
    and credit for Doyle Printing & Offset Co.  When originally reported, it was indicated,
    as one entry, that the amount charged and due to Doyle Printing & Offset Co. was
    $1057.50  for Ohio and Texas independent expenditures.  In a previously amended
    report, the Doyle Printing & Offset Co. entry  was split into two entries, each
    totaling $528.75 for primary independent expenditures in Ohio and Texas.  The
    original payment to Doyle Printing and Offset Co. was for  $1057.50 and never
    changed to two entries which left an outstanding balance and credit of $528.75.
    \ When the payment was changed to two payments of $528.75 this resolved the outstanding
    balance and credit. "
